func maxNumberOfAlloys(n int, k int, budget int, composition [][]int, stock []int, cost []int) int {
 maxAlloys := 0
 for i := 0; i < k; i++ {
  minAlloys := budget + 1
  for j := 0; j < n; j++ {
   needed := composition[i][j] - stock[j]
   if needed < 0 {
    needed = 0
   }
   totalCostForMetal := needed * cost[j]
   alloysForThisMetal := (budget - totalCostForMetal) / (composition[i][j] * cost[j])
   if stock[j] >= composition[i][j] {
    alloysForThisMetal = budget / (composition[i][j] * cost[j])
   }
   if needed == 0 {
    alloysForThisMetal = budget / (composition[i][j] * cost[j])
   }
   if alloysForThisMetal < minAlloys {
    minAlloys = alloysForThisMetal
   }
  }
  if minAlloys > maxAlloys {
   maxAlloys = minAlloys
  }
 }
 return maxAlloys
}
